import React from 'react'

function Login() {
    return (
        <div className="form-group">
            <div className="form-control col-sm-4">
                <label for="name">Your name</label>
                <input type="text" value="name" placeholder="enter your name"></input>
            </div>
            
        </div>
    )
}

export default Login
